import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Products extends Component {
    render() {
        return (
            <div>
                <h1>Products : </h1>
                <ul>
                    <li><Link to="/p">Product 1</Link></li>
                    <li><Link to="/p">Product 2</Link></li>
                    <li><Link to="/p">Product 3</Link></li>
                    <li><Link to="/p">Product 4</Link></li>
                    <li><Link to="/p">Product 5</Link></li>
                </ul>
            </div>
        );
    }
}

export default Products;
